  false,\n\t\"url\": null,\n\t\"notes\": \"We are using genetic parentage analysis
  to measure the relative fitness of hatchery and wild spring run Chinook salmon that
  spawn in the Wenatchee River. In addition to hatchery and wild origin, we are examining
  how variation among individuals in age, size, run timing, spawning location, and
  aspects of past ancestry influence relative fitness.nnMicrosatellite data from spring
  run Wenatchee River Chinook salmon.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
